var validator
var textValidator
var critValidator
var user

function addKrit(self, krit) {
    val = self.val();
    if (Array.isArray(krit[val])) return false;
    var chars = Object.keys(krit[val]);
    var sel = '<select required name="F' + createdKrits.length+ '"class="form-control selectors ">';
    sel += '<option selected disabled value="">Выберите характеристику</option>'
    for (ch of chars) {
        sel += '<option>' + ch + '</option>';
    }
    sel += '</select>'

    if (self.kritChild) self.kritChild.removeKritsChilds();

    var k = $(sel).appendTo('#form');
    k.change(function() {

        addKrit(k, krit[self.val()])});


    self.kritChild = k;
    k.krit = krit[val]

    k.removeKritsChilds = (function () {
       if (k.kritChild) k.kritChild.removeKritsChilds()

       k.remove()
    })
    createdKrits.push(k)
}


function getChars(self, array) {
    array.push(self.val())
    console.log(self.val())
    if (self.kritChild) getChars(self.kritChild, array)
}

